/*
сделать страничку, где сверху будет менюшка "главное, цены, контакты"
в главном сделать описание что такое таро, 
а под ним сделать какой-нибудь красивый список возможных раскладов с возможностью клика на него 
и зайти как бы внутрь почитать подробней
*/
import Header from './common/header';
import './App.css';
import Main from './pages/main';
import { Layout } from './common/layout';

function App() {
  return (
    <div className="App">
      <Layout>
        <Main />
      </Layout>
    </div>
  );
}

export default App;
